// 1. Install dependencies DONE
// 2. Import dependencies DONE
// 3. Setup webcam and canvas DONE
// 4. Define references to those DONE
// 5. Load posenet DONE
// 6. Detect function DONE
// 7. Drawing utilities from tensorflow DONE
// 8. Draw functions DONE

// Face Mesh - https://github.com/tensorflow/tfjs-models/tree/master/facemesh

import React, { useRef, useLayoutEffect, useState } from "react";
import "./App.css";
import * as tf from "@tensorflow/tfjs";
// OLD MODEL
//import * as facemesh from "@tensorflow-models/facemesh";

// NEW MODEL
import * as facemesh from "@tensorflow-models/face-landmarks-detection";
import Webcam from "react-webcam";
import { drawMesh } from "./utilities";
import DasAlerts from "./report";
import AppBar from "./AppBar";

import {Button, Container, ButtonGroup, makeStyles} from '@material-ui/core';

const useStyles = makeStyles((theme) => ({
  root: {
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    '& > *': {
      margin: theme.spacing(),
    },
  },
}));

var id_2, id_152, id_9, id_10, id_127, id_130, id_243, id_463, id_359, id_356;

function App() {
  const classes = useStyles();
  const webcamRef = useRef(null);
  const canvasRef = useRef(null);
  const [draw, setDraw] = useState(0);
  const [visible, setAlertVisibility] = useState(false);
  const [eyeVisible, setEyeVisibility] = useState(false);

  //  Load posenet
  const runFacemesh = async (key) => {
    // OLD MODEL
    // const net = await facemesh.load({
    //   inputResolution: { width: 640, height: 480 },
    //   scale: 0.8,
    // });
    // NEW MODEL
    const net = await facemesh.load(facemesh.SupportedPackages.mediapipeFacemesh);
    setInterval(() => {
      detect(net, key);
    }, 5);
  };

  const detect = async (net, key) => {
    if (
      typeof webcamRef.current !== "undefined" &&
      webcamRef.current !== null &&
      webcamRef.current.video.readyState === 4
    ) {
      // Get Video Properties
      const video = webcamRef.current.video;
      const videoWidth = webcamRef.current.video.videoWidth;
      const videoHeight = webcamRef.current.video.videoHeight;

      // Set video width
      webcamRef.current.video.width = videoWidth;
      webcamRef.current.video.height = videoHeight;

      // Set canvas width
      canvasRef.current.width = videoWidth;
      canvasRef.current.height = videoHeight;

      // Make Detections
      // OLD MODEL
      //       const face = await net.estimateFaces(video);
      // NEW MODEL
      const face = await net.estimateFaces({input:video});
      // console.log(face);
      // id_9 = face.scaledMesh[9];
      // id_10 = face.scaledMesh[10];
      // id_2 = face.scaledMesh[2];
      // id_152 = face.scaledMesh[152];
      // id_127 = face.scaledMesh[127];
      // id_130 = face.scaledMesh[130]; 
      // id_243 = face.scaledMesh[243];
      // id_463 = face.scaledMesh[463];
      // id_359 = face.scaledMesh[359];
      // id_356 = face.scaledMesh[356];

      face["0"]["scaledMesh"] == 'defined' ? 1 : console.log(face["0"]["scaledMesh"]);

      // Get canvas context
      const ctx = canvasRef.current.getContext("2d");
      requestAnimationFrame(()=>{drawMesh(face, ctx, draw)});
    }
  };

  useLayoutEffect(()=>{runFacemesh(); return () => {}},[draw]);

  return (
    <div className="App">
      <AppBar/>
      <Container>
      <div className={classes.root}>
      <ButtonGroup variant="contained" color="secondary" aria-label="contained primary button group">
        <Button
          onClick={() => setDraw(draw + 1)}
        >
          下一个部位建模
        </Button>
        <Button
          onClick={() => setDraw(draw - 1)}
        >
          返回上一个部位
        </Button>
        </ButtonGroup>
      </div>
      {/* <div>current draw is {draw}.</div> */}
      <div className={classes.root}>
      <ButtonGroup size="small" variant="contained" color="secondary" aria-label="contained primary button group">
      <Button 
        onClick={()=> setTimeout(() => {setAlertVisibility(true)},2000)}>
          全脸扫描反馈
      </Button>
      <Button 
        onClick={()=> setTimeout(() => {setEyeVisibility(true)},2000)}>
          眼部扫描反馈
      </Button>
      </ButtonGroup>
      </div>
      </Container>
      <div>
      <DasAlerts
        visible={visible}
        duration={5000}
        onDurationEnd={setAlertVisibility}
      >
        <div>你的三庭比例：</div>
        </DasAlerts>
      </div>
      <div>
      <DasAlerts
        visible={eyeVisible}
        duration={20000000}
        onDurationEnd={setEyeVisibility}
      >
        <div>Fix your eyes.</div>
        </DasAlerts>
      </div>
      <header className="App-header">
        <Webcam
          ref={webcamRef}
          style={{
            position: "absolute",
            marginLeft: "auto",
            marginRight: "auto",
            left: 0,
            right: 0,
            textAlign: "center",
            zindex: 9,
            width: 1000,
            height: 750,
          }}
        />

        <canvas
          ref={canvasRef}
          style={{
            position: "absolute",
            marginLeft: "auto",
            marginRight: "auto",
            left: 0,
            right: 0,
            textAlign: "center",
            zindex: 9,
            width: 1000,
            height: 750,
          }}
        />
      </header>
    </div>
  );
}

export default App;
